export default function BalanceInfos(props) {
    return(
        <div className="rubric">
            <div className="title">{"Letzte Buchungen"}</div>
            <div className="wrapper">
                {getLastBookings().map(({amount, correction})=>{return <div>{amount+" "+(correction==null?"":" | cor. "+correction)}</div>;})}
            </div>
        </div>
    );
}

function getLastBookings() {
    //do server 
    const bookings = [
        {amount: -5.3,  correction: 0}, 
        {amount: -0.83, correction: +2.1},
        {amount: -1.4,  correction: 0},
    ];
    return bookings;
}
